import React from "react";
import "primereact/resources/themes/bootstrap4-light-blue/theme.css"; //theme
import "primereact/resources/primereact.min.css"; //core css
import "primeicons/primeicons.css";
import { FormLoginHtml } from "./login/FormLogin";
import { ButtonsCheck } from "./shared/Buttons/ButtonsPrimary";
function App() {
  return (
    <React.Fragment>
      <FormLoginHtml />
      <ButtonsCheck />
    </React.Fragment>
  );
}

export default App;
